/* ABCD is a vector of THREE.Vector3 positions
    */
var generateSphericalLinesFromPLane = function( ABCD, K=10 ) {
    var g = new THREE.Geometry();
    var I = ABCD.length;

    ABCD.push(ABCD[0]);
    for(var i=0; i<I; ++i) {
        var A = ABCD[i];
        var B = ABCD[i+1];

        for(var k=0; k<K; ++k) {
            var a = k / K;
            var p = new THREE.Vector3();
            p.addScaledVector(A, a);
            p.addScaledVector(B, 1-a);
            p.setLength(3.001);
            g.vertices.push(p);

            var a = (k+1) / K;
            var p = new THREE.Vector3();
            p.addScaledVector(A, a);
            p.addScaledVector(B, 1-a);
            p.setLength(3.001);
            g.vertices.push(p);
        }
    }

    return g;
}

var generateLinesToPLane = function( P, ABCD, K=10 ) {
    var g = new THREE.Geometry();
    var I = ABCD.length;

    for(var i=0; i<I; ++i) {
        var A = ABCD[i];

        var p = new THREE.Vector3();
        p.add(P);
        g.vertices.push(p);

        var p = new THREE.Vector3();
        p.add(A);
        g.vertices.push(p);
    }

    return g;
}

